            <Route path="/Games"element={ <Games /> }></Route>
            {/* <Route element={<PersistLogin />}>
                <Route element={<RequireAuth />}>                     */}
                    <Route path="*" element={<Navigate to="/Home" replace />}/>
                {/* </Route>
            </Route> */}
      </Routes>
    )
}

export default App;
